const regMenuBar = () => {

    const DMSTookit = new DMS_UserScripts.Toolkit({
        GM_info,
        GM_addStyle,
        GM_getValue,
        GM_setValue,
        GM_deleteValue,
        GM_registerMenuCommand,
        GM_unregisterMenuCommand,
        GM_openInTab,
    })

    const configName = 'spy_config'
    const configMap = DMSTookit.proxyDataAuto(configName, {
        enable: true
    })

    DMSTookit.menuToggle(configMap, 'enable', '1', '1')
    DMSTookit.menuLink('2', 'https://github.com/giveme0101/spypp')

    return configMap;
}

const regCilckEvent = () => {
    document.addEventListener("dblclick", function(event){
        var obj = event.srcElement;
		if (obj.nodeName === 'INPUT'){
			if (obj.type === 'password') {
				obj.type = 'text', obj.bk_type = 'p';
				return;
			}
			if (obj.bk_type === 'p' ){
				obj.type = 'password', obj.bk_type = null;
			}
		}
    });
}

(function() {
    'use strict';

    const config = regMenuBar();
    config.enable && regCilckEvent();

})();